    true,nt"url": null,nt"notes": "Arts Education Surveys of Elementary School
    Teachers, 2009 (FRSS 102), is a study that is part of the Quick Response Information
    System. FRSS 102 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides
    national estimates on arts education and arts instructors in public elementary schools
    during the 2009-10 school year. The study was conducted using mailed questionnaires
    that could be completed via mail or the web. Follow-up telephone interviews were
    also conducted. Elementary school teachers were sampled. The response rate for each
    of the three surveys was 86.5 percent for the music specialist survey, 87.6 percent
    for the visual arts specialist survey, and 81.5 percent for the classroom teacher
    survey. Key statistics produced from FRSS 102 were data on the teaching load of
    music and visual arts specialists in elementary schools; teacher participation in
    various professional development activities; the ways in which self-contained classroom
    teachers teach arts education as part of their instructional program; and teachersufffd
    use of formal methods of assessment of studentsufffd achievement in the arts.",nt"license_title":
